import React from 'react';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import TextField from '@material-ui/core/TextField';
import './Table.css';

function Tables({ userInfo }) {

    return (
        userInfo && <div className="table">
            <div className="modal__fade">
                <form className="modal__dataepickerForm" noValidate>
                    <TextField
                        id="datetime-local"
                        type="datetime-local"
                        defaultValue="2017-05-24T10:30"
                        className="modal__datepicker"
                        InputLabelProps={{
                            shrink: true,
                        }}
                    />
                </form>
            </div>
            <TableContainer component={Paper}>
                <Table className="table" aria-label="simple table">
                    <TableHead>
                        <TableRow>
                            <TableCell align="left">Start Time</TableCell>
                            <TableCell align="left">End Time</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {userInfo.activity_periods.map((time, i) => (
                            <TableRow key={time.start_time + i}>
                                <TableCell component="th" scope="row">
                                    {time.start_time}
                                </TableCell>
                                <TableCell align="left">{time.end_time}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        </div>
    )
}

export default Tables;
